package com.hunter.study.leetcode.d0711;import java.util.Deque;import java.util.LinkedList;/** * @Author 水木 * @Date 2021/3/3  1:40 下午 */public class Solution {	public int numTrees(int n) {		if(n<1){			return 1;		}		for(int i=1 ; i<=n;i++){			return numTrees(i-1)*numTrees(n-i);		}		return 0;	}	public static void main(String[] args) {		Deque<Integer> queue=new LinkedList<Integer>();		queue.add(1);		queue.add(null);		queue.add(null);		System.out.println(queue.pollFirst());	}}